import './App.css';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import PrivateRoute from './utils/PrivateRoute';
import { AuthProvider } from './context/AuthContext';

import Sidebar from './components/Sidebar';

import HomePage from './pages/HomePage';
import LoginPage from './pages/LoginPage';
import ProjectPage from './pages/ProjectPage';
import ProjectDetailsPage from './pages/ProjectDetailsPage';
import NewProjectPage from './pages/NewProjectPage';
import ClientDetailsPage from './pages/ClientDetailsPage';
import ManagerClientPage from './pages/ManagerClientPage';
import DashboardPage from './pages/DashboardPage';

function App() {
  return (
    <div className="App">
       <div>
        <div className='container-fluid'>
          <div className='row base'>
            <div className='sidebar col-3'>
              <Sidebar/>
            </div>
            <div className="main col m-2 p-3">
              <div className="fw-bold" style={{fontSize: "1.525em"}}>
                <sapn><i className="bi bi-house-door-fill"></i></sapn>
                <span className="d-inline-block"><h4> Dashboard</h4></span>
              </div>
              <div className="row total-row">
                <div className="col m-2 p-3">Total Projects</div>
                <div className="col m-2 p-3">Pending Projects</div>
                <div className="col m-2 p-3">Ongoing Projects</div>
                <div className="col m-2 p-3">Completed Projects</div>
              </div>
            </div>
          </div>
        </div>
      </div>
      <Router>
        <AuthProvider>
          {/* <PrivateRoute component={DashboardPage} path="/" exact/> */}
          <PrivateRoute component={HomePage} path="/home"/>
          <PrivateRoute component={ProjectPage} path="/project"/>
          <PrivateRoute component={ProjectDetailsPage} path="/project-details"/>
          <PrivateRoute component={NewProjectPage} path="/new-project"/>
          <PrivateRoute component={ManagerClientPage} path="/mc"/>
          <PrivateRoute component={ClientDetailsPage} path="/clnt"/>
          <Route component={LoginPage} path="/login"/>
        </AuthProvider>
      </Router>
    </div>
  );
}

export default App;
